<!DOCTYPE html>
<html lang="en" data-theme="dark">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Amy Marketplace | Premium Accounts</title>
    <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.0.0/css/all.min.css">
    <link href="https://fonts.googleapis.com/css2?family=Inter:wght@300;400;500;600;700&display=swap" rel="stylesheet">
    <style>
        :root {
            --primary: #6C5CE7;
            --secondary: #A8A5E6;
            --accent: #FF7675;
            --dark: #1A1A24;
            --light: #FFFFFF;
            --gradient: linear-gradient(135deg, #6C5CE7 0%, #84A9FF 100%);
        }

        html[data-theme="dark"] {
            --bg-color: #0F0F1A;
            --header-bg: #1A1A24;
            --text-color: rgba(255, 255, 255, 0.9);
            --text-secondary: rgba(255, 255, 255, 0.7);
            --card-bg: rgba(26, 26, 36, 0.95);
            --card-border: rgba(255, 255, 255, 0.08);
            --card-hover-bg: rgba(35, 35, 45, 0.95);
            --input-bg: rgba(26, 26, 36, 0.8);
            --input-border: rgba(255, 255, 255, 0.1);
            --card-shadow: 0 10px 30px rgba(0, 0, 0, 0.25);
            --card-hover-shadow: 0 15px 35px rgba(108, 92, 231, 0.2);
            --feature-bg: rgba(108, 92, 231, 0.15);
        }

        html[data-theme="light"] {
            --bg-color: #F5F7FA;
            --header-bg: #FFFFFF;
            --text-color: #333333;
            --text-secondary: #666666;
            --card-bg: #FFFFFF;
            --card-border: #E5E9F0;
            --card-hover-bg: #FFFFFF;
            --input-bg: #FFFFFF;
            --input-border: #E5E9F0;
            --card-shadow: 0 10px 30px rgba(0, 0, 0, 0.08);
            --card-hover-shadow: 0 15px 35px rgba(108, 92, 231, 0.15);
            --feature-bg: rgba(108, 92, 231, 0.08);
        }

        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
            font-family: 'Inter', sans-serif;
        }

        body {
            background: var(--bg-color);
            color: var(--text-color);
            line-height: 1.6;
            transition: background-color 0.3s ease;
        }

        header {
            background: var(--header-bg);
            padding: 6rem 2rem 8rem;
            text-align: center;
            position: relative;
            overflow: hidden;
            background-image: url('https://www.freepnglogos.com/uploads/roblox/roblox-logo-roblox-symbol-meaning-history-and-evolution-3.jpg');
            background-size: cover;
            background-position: center;
            background-blend-mode: overlay;
        }

        header::before {
            content: '';
            position: absolute;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            background: linear-gradient(to bottom, 
                rgba(15, 15, 26, 0.8), 
                rgba(15, 15, 26, 0.95));
            z-index: 1;
        }

        html[data-theme="light"] header::before {
            background: linear-gradient(to bottom, 
                rgba(255, 255, 255, 0.8), 
                rgba(255, 255, 255, 0.95));
        }

        .header-content {
            position: relative;
            z-index: 2;
            max-width: 800px;
            margin: 0 auto;
        }

        .logo {
            font-size: 3.5rem;
            font-weight: 800;
            margin-bottom: 1.5rem;
            background: var(--gradient);
            -webkit-background-clip: text;
            background-clip: text;
            color: transparent;
            display: inline-block;
            text-shadow: 0 5px 15px rgba(108, 92, 231, 0.3);
            letter-spacing: -1px;
        }

        .tagline {
            font-size: 1.3rem;
            margin-bottom: 2rem;
            color: var(--text-secondary);
        }

        .header-cta {
            display: inline-block;
            padding: 0.9rem 2rem;
            background: var(--primary);
            color: white;
            border-radius: 30px;
            font-weight: 600;
            text-decoration: none;
            transition: all 0.3s ease;
            border: none;
            cursor: pointer;
            box-shadow: 0 8px 20px rgba(108, 92, 231, 0.4);
        }

        .header-cta:hover {
            transform: translateY(-3px);
            box-shadow: 0 12px 25px rgba(108, 92, 231, 0.5);
        }

        .header-stats {
            display: flex;
            justify-content: center;
            gap: 3rem;
            margin-top: 3rem;
        }

        .stat-item {
            text-align: center;
        }

        .stat-number {
            font-size: 2.2rem;
            font-weight: 700;
            color: var(--accent);
            margin-bottom: 0.5rem;
        }

        .stat-label {
            font-size: 0.9rem;
            color: var(--text-secondary);
            text-transform: uppercase;
            letter-spacing: 1px;
        }

        header::after {
            content: '';
            position: absolute;
            bottom: -50px;
            left: 0;
            width: 100%;
            height: 100px;
            background: var(--gradient);
            transform: skewY(-3deg);
            z-index: 0;
        }

        .categories-nav {
            display: flex;
            justify-content: center;
            gap: 1rem;
            padding: 1rem;
            flex-wrap: wrap;
            max-width: 1200px;
            margin: -2rem auto 3rem;
            position: relative;
            z-index: 3;
        }

        .category-btn {
            padding: 0.8rem 1.5rem;
            border: 2px solid var(--card-border);
            border-radius: 12px;
            background: var(--input-bg);
            color: var(--text-secondary);
            cursor: pointer;
            transition: all 0.3s cubic-bezier(0.4, 0, 0.2, 1);
            backdrop-filter: blur(10px);
            font-weight: 500;
        }

        .category-btn.active,
        .category-btn:hover {
            background: var(--primary);
            border-color: var(--primary);
            color: white;
            transform: translateY(-2px);
            box-shadow: 0 8px 24px rgba(108, 92, 231, 0.3);
        }

        .products-container {
            display: grid;
            grid-template-columns: repeat(auto-fit, minmax(320px, 1fr));
            gap: 2rem;
            padding: 2rem;
            max-width: 1400px;
            margin: 0 auto;
        }

        .product-card {
            background: var(--card-bg);
            border-radius: 16px;
            overflow: hidden;
            transition: all 0.3s cubic-bezier(0.4, 0, 0.2, 1);
            position: relative;
            box-shadow: var(--card-shadow);
            border: 1px solid var(--card-border);
            display: flex;
            flex-direction: column;
        }

        .product-card:hover {
            transform: translateY(-5px);
            box-shadow: var(--card-hover-shadow);
            border-color: var(--primary);
        }

        .product-image-container {
            position: relative;
            overflow: hidden;
            height: 200px;
        }

        .product-image {
            width: 100%;
            height: 100%;
            object-fit: cover;
            transition: transform 0.5s ease;
        }

        .product-card:hover .product-image {
            transform: scale(1.05);
        }

        .product-category {
            position: absolute;
            top: 15px;
            right: 15px;
            background: rgba(108, 92, 231, 0.9);
            color: white;
            padding: 5px 10px;
            border-radius: 20px;
            font-size: 0.75rem;
            font-weight: 600;
            text-transform: uppercase;
            letter-spacing: 0.5px;
        }

        .product-content {
            padding: 1.5rem;
            display: flex;
            flex-direction: column;
            flex-grow: 1;
        }

        .product-header {
            display: flex;
            justify-content: space-between;
            align-items: center;
            margin-bottom: 1rem;
        }

        .product-title {
            font-size: 1.4rem;
            font-weight: 600;
            color: var(--text-color);
            margin: 0;
        }

        .product-price {
            color: var(--accent);
            font-size: 1.5rem;
            font-weight: 700;
            display: flex;
            align-items: center;
            gap: 0.5rem;
        }

        .product-price::before {
            content: '';
            display: inline-block;
            width: 10px;
            height: 10px;
            background-color: #4CD964;
            border-radius: 50%;
        }

        .product-divider {
            height: 1px;
            background: var(--card-border);
            margin: 0.5rem 0 1.2rem;
        }

        .features-list {
            list-style: none;
            margin: 0 0 1.5rem;
            flex-grow: 1;
        }

        .features-list li {
            margin: 0.7rem 0;
            display: flex;
            align-items: center;
            gap: 0.8rem;
            font-size: 0.95rem;
            color: var(--text-secondary);
        }

        .features-list i {
            color: var(--primary);
            width: 24px;
            height: 24px;
            border-radius: 6px;
            background: var(--feature-bg);
            display: flex;
            align-items: center;
            justify-content: center;
            font-size: 0.8rem;
        }

        .product-description {
            font-size: 0.9rem;
            color: var(--text-secondary);
            margin-bottom: 1.5rem;
            line-height: 1.6;
        }

        .product-footer {
            display: flex;
            justify-content: space-between;
            align-items: center;
            margin-top: auto;
        }

        .buy-now-btn {
            padding: 0.7rem 1.5rem;
            background: var(--primary);
            color: white;
            border: none;
            border-radius: 8px;
            font-weight: 600;
            cursor: pointer;
            transition: all 0.3s ease;
            display: flex;
            align-items: center;
            gap: 0.5rem;
        }

        .buy-now-btn:hover {
            background: #5a4cdb;
            transform: translateY(-2px);
        }

        .product-meta {
            display: flex;
            align-items: center;
            gap: 1rem;
            color: var(--text-secondary);
            font-size: 0.85rem;
        }

        .product-meta i {
            font-size: 0.9rem;
        }

        footer {
            background: var(--header-bg);
            color: var(--text-secondary);
            text-align: center;
            padding: 4rem 2rem;
            margin-top: 6rem;
            border-top: 1px solid var(--card-border);
            position: relative;
        }

        .footer-content {
            max-width: 1200px;
            margin: 0 auto;
            display: flex;
            flex-direction: column;
            align-items: center;
        }

        .footer-links {
            display: flex;
            gap: 2rem;
            margin-bottom: 2rem;
        }

        .footer-links a {
            color: var(--text-secondary);
            text-decoration: none;
            transition: color 0.3s ease;
        }

        .footer-links a:hover {
            color: var(--primary);
        }

        .loading {
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: center;
            padding: 4rem;
            color: var(--text-secondary);
        }

        .spinner {
            border: 4px solid var(--card-border);
            border-left-color: var(--primary);
            border-radius: 50%;
            width: 40px;
            height: 40px;
            animation: spin 1s linear infinite;
            margin-bottom: 1rem;
        }

        @keyframes spin {
            to { transform: rotate(360deg); }
        }

        h1 {
            font-size: 2.8rem;
            margin-bottom: 1rem;
            font-weight: 700;
            letter-spacing: -0.5px;
        }

        h3 {
            font-size: 1.4rem;
            margin-bottom: 0.5rem;
            font-weight: 600;
        }

        p {
            color: var(--text-secondary);
            line-height: 1.8;
        }

        .back-to-top {
            position: fixed;
            bottom: 30px;
            right: 30px;
            width: 50px;
            height: 50px;
            border-radius: 50%;
            background: var(--primary);
            color: white;
            display: flex;
            align-items: center;
            justify-content: center;
            cursor: pointer;
            opacity: 0;
            visibility: hidden;
            transition: all 0.3s ease;
            box-shadow: 0 5px 15px rgba(108, 92, 231, 0.4);
            z-index: 100;
        }

        .back-to-top.visible {
            opacity: 1;
            visibility: visible;
        }

        .back-to-top:hover {
            transform: translateY(-5px);
            box-shadow: 0 8px 20px rgba(108, 92, 231, 0.5);
        }

        .search-container {
            max-width: 600px;
            margin: 0 auto 2rem;
            position: relative;
            z-index: 3;
        }

        .search-input {
            width: 100%;
            padding: 1rem 1.5rem;
            border-radius: 30px;
            border: 2px solid var(--input-border);
            background: var(--input-bg);
            color: var(--text-color);
            font-size: 1rem;
            backdrop-filter: blur(10px);
            transition: all 0.3s ease;
            padding-left: 3rem;
        }

        .search-icon {
            position: absolute;
            left: 1.2rem;
            top: 50%;
            transform: translateY(-50%);
            color: var(--text-secondary);
            opacity: 0.5;
        }

        .search-input:focus {
            outline: none;
            border-color: var(--primary);
            box-shadow: 0 0 0 3px rgba(108, 92, 231, 0.3);
        }

        .search-input::placeholder {
            color: var(--text-secondary);
            opacity: 0.5;
        }

        .no-results {
            grid-column: 1 / -1;
            text-align: center;
            padding: 3rem;
            background: var(--card-bg);
            border-radius: 16px;
            border: 1px solid var(--card-border);
            box-shadow: var(--card-shadow);
        }

        .theme-toggle {
            position: absolute;
            top: 20px;
            right: 20px;
            z-index: 10;
            background: rgba(26, 26, 36, 0.8);
            border: 1px solid rgba(255, 255, 255, 0.1);
            color: white;
            width: 40px;
            height: 40px;
            border-radius: 50%;
            display: flex;
            align-items: center;
            justify-content: center;
            cursor: pointer;
            transition: all 0.3s ease;
        }

        html[data-theme="light"] .theme-toggle {
            background: rgba(255, 255, 255, 0.8);
            border: 1px solid rgba(0, 0, 0, 0.1);
            color: #333;
        }

        .theme-toggle:hover {
            background: var(--primary);
            color: white;
        }

        .special-badge {
            position: absolute;
            top: 15px;
            left: 15px;
            background: var(--accent);
            color: white;
            padding: 5px 10px;
            border-radius: 20px;
            font-size: 0.75rem;
            font-weight: 600;
            z-index: 2;
            text-transform: uppercase;
            letter-spacing: 0.5px;
        }

        @media (max-width: 768px) {
            header {
                padding: 4rem 1rem 6rem;
            }
            
            .logo {
                font-size: 2.5rem;
            }
            
            .tagline {
                font-size: 1.1rem;
            }
            
            .header-stats {
                flex-direction: column;
                gap: 1.5rem;
            }
            
            .category-btn {
                padding: 0.6rem 1.2rem;
                font-size: 0.9rem;
            }
            
            .products-container {
                padding: 1rem;
                grid-template-columns: 1fr;
            }
            
            .search-container {
                padding: 0 1rem;
            }
            
            .back-to-top {
                bottom: 20px;
                right: 20px;
                width: 40px;
                height: 40px;
            }
        }

        @keyframes fadeIn {
            from { opacity: 0; transform: translateY(20px); }
            to { opacity: 1; transform: translateY(0); }
        }
    </style>
</head>
<body>
    <header>
        <button class="theme-toggle" id="themeToggle" aria-label="Toggle dark/light mode">
            <i class="fas fa-moon"></i>
        </button>
        <div class="header-content">
            <h1 class="logo">Amy Market</h1>
            <p class="tagline">Premium Roblox accounts and collectibles</p>
            <a href="#productsContainer" class="header-cta">Browse Accounts</a>
            
            <div class="header-stats">
                <div class="stat-item">
                    <div class="stat-number">500+</div>
                    <div class="stat-label">Accounts Sold</div>
                </div>
                <div class="stat-item">
                    <div class="stat-number">100%</div>
                    <div class="stat-label">Secure Transactions</div>
                </div>
                <div class="stat-item">
                    <div class="stat-number">24/7</div>
                    <div class="stat-label">Customer Support</div>
                </div>
            </div>
        </div>
    </header>

    <div class="search-container">
        <i class="fas fa-search search-icon"></i>
        <input type="text" class="search-input" id="searchInput" placeholder="Search accounts by name, features or category..." aria-label="Search accounts">
    </div>

    <nav class="categories-nav">
        <button class="category-btn active" data-category="all" aria-label="Show all accounts"><i class="fas fa-th"></i> All Accounts</button>
        <button class="category-btn" data-category="offsale" aria-label="Show offsale accounts"><i class="fas fa-tag"></i> Offsales</button>
        <button class="category-btn" data-category="3l3c" aria-label="Show 3L and 3C accounts"><i class="fas fa-text-width"></i> 3L & 3C</button>
        <button class="category-btn" data-category="names" aria-label="Show named accounts"><i class="fas fa-user"></i> Names</button>
    </nav>

    <div class="products-container" id="productsContainer">
        <div class="loading">
            <div class="spinner"></div>
            <p>Loading accounts...</p>
        </div>
    </div>

    <button class="back-to-top" id="backToTop" aria-label="Back to top">
        <i class="fas fa-arrow-up"></i>
    </button>

    <footer>
        <div class="footer-content">
            <div class="footer-links">
                <a href="#">Terms of Service</a>
                <a href="#">Privacy Policy</a>
                <a href="#">Contact Us</a>
                <a href="#">FAQ</a>
            </div>
            <p>&copy; 2025 Amy Roblox Accounts. All rights reserved.</p>
        </div>
    </footer>
